import Header from './header.js'

const Intermediate = ({ functions }) => {
  const [
    setWidth,
    setHeight,
    setMineCount,
    initializeGrid
  ] = functions
  const width = 16
  const height = 16
  const mineCount = 40
  return (
    <>
      <Header
        width={width} height={height} mineCount={mineCount}
        functions={[
          setWidth,
          setHeight,
          setMineCount,
          initializeGrid
        ]}
      />
    </>
  )
}

export default Intermediate
